import "./ProfilePage.css";
import MbtiCriteria from "../components/MbtiCriteria";
import click from "../images/tap.gif";

function ProfilePage() {
  return (
    <>
      <div className="input-name">
        <p>
          <span id="accent-txt">이름</span>을 입력해주세요
        </p>
        <input />
      </div>
      <div className="input-mbti">
        <p>
          <span id="accent-txt">MBTI</span>를 선택해주세요
        </p>
        <img src={click} alt="click" width="30px" />
        <div>
          <MbtiCriteria />
        </div>
      </div>
    </>
  );
}

export default ProfilePage;
